  // 小尺寸 油价字体/大小
  const Swnamefont = new Font("Chalkduster", 20);
  // 中尺寸 标题字体/大小
  const Mtitlefont = Font.boldSystemFont(16);
  // 中尺寸 标题字体颜色
  const Mtitlefontcolor = Color.white();
  // 中尺寸 油价字体/大小
